import React from "react";
import { connect } from "react-redux";

const ProjectList = props => {
  return (
    <>
      <div>props.projects</div>
    </>
  );
};

const mapStateToProps = state => {
  return {
    projects: state.projects
  };
};
export default connect(mapStateToProps, {})(ProjectList);
